histogramDefault_id6(256, :) = sum(histogram_i255k_id6);
histogramDefault_id6(2:255, 256) = (sum(histogram_ij255_id6(:, 2:255))).';

% Set the format to longe to capture the differences in the experimental probabilities
format longe

